message:
Quebrando Narrativas.

Toda postagem que contenham;

Áudios;
Fotos;
Vídeos;
Alguém me disse;
Ouvi falar;
Conversei com um Militar;
Tenho uma Fonte Confiável;
Vi em um site;
Vi na TV;

Peça a Fonte Original e Primária com Data e Horário e Confronte as Informações para Valida-las.

Caso não tenham Fontes Originais e Primárias Ignore, Desconsiderem esse tipo de Narrativas.

Nessa Reta Final esta chovendo Narrativas da Esquerda, não acreditem em nada, Somente nas Forças Armadas e no Presidente.

Todo o Resto é Papo Furado.
